import React from 'react';

interface Home {
  heroImgUrl: string | undefined;
  Login: JSX.Element;
  children?: React.ReactChild | React.ReactChild[];
}

function Home({ heroImgUrl, Login }: Home) {
  return (
    <div id="content" className="flex grow flex-col lg:flex-row ">
      <section className="flex w-full shrink-0 justify-center lg:w-1/2">
        <div className="mx-0 flex grow items-start justify-center py-2 lg:mr-1">
          <img src={heroImgUrl} className="h-auto w-full  object-cover" />
        </div>
      </section>
      <section className="flex w-full justify-center  lg:w-1/2">
        <div className="mx-0 flex grow justify-center py-2 lg:ml-1">
          {Login}
        </div>
      </section>
    </div>
  );
}

export default Home;
